'''

Example 1:
Input: s = |**|*|*, startIndices = [1, 1], endIndices = [5, 6]
Output: [2, 3]
Explanation:
The string has a total of 2 closed compartments, one with 2 items and one with 1 item.
For the first pair of indices, (0, 4), the substring |**|*. There are 2 items in a compartment.
For the second pair of indices, (0, 6), the substring is |**|*|* and there are 2 + 1 = 3 items in compartments.
Both of the answers are returned in an array, [2, 3]
Example 2:
Input: s = *|*|, startIndices = [1], endIndices = [3]
Output: [1]
Explanation:
the substring from index = 1 to index = 3 is |*|. There is one compartments with one item in this string.

My solution recursively select the first container "|?|" based on the start and end parameters.
I implement a cache because in long strings probably substrings will repeated.

'''
def items_in_container(items, start_indices, end_indices):
    ln = len(items)
    item_count = [0 for _ in range(ln)]
    left_pipes = [-1 for _ in range(ln)]
    right_pipes = [-1 for _ in range(ln)]

    for index, char in enumerate(items):
        if index == 0:
            if char == "|":
                left_pipes[index] = index
        else:
            if char == "|":
                left_pipes[index] = index
                item_count[index] = item_count[index-1]
            else:
                left_pipes[index] = left_pipes[index-1]
                item_count[index] = item_count[index-1] + 1

    for index, char in enumerate(items[::-1]):
        n = len(items) - index - 1
        if char == "|":
            right_pipes[n] = n
        else:
            right_pipes[n] = right_pipes[n+1] if n < len(items)-1 else n

    if left_pipes[-1] == -1:
        return [0]*len(start_indices)

    answer = list()

    for index in range(len(start_indices)):
        left_pipe = right_pipes[start_indices[index]-1]
        right_pipe = left_pipes[end_indices[index]-1]
        answer.append(item_count[right_pipe] - item_count[left_pipe] if right_pipe > left_pipe else 0)

    return answer




cache = {}
def count_items_in_containers_dinamically(containers, start, end, end_abs):
    
    if containers[start] != '|*': start = containers.find('|*', start, end_abs + 1)
    end = containers.find('|', start + 1, end_abs + 1)

    items_total = 0
    items = 0

    while start >= 0 and end > 0:
        
        
        container_pos = (start, end)

        if container_pos in cache:
             items_total += cache[container_pos]
        else:
            for item in containers[start: end]:
                if item == '*': items += 1

            items_total += items
            cache[container_pos] = items
            items = 0

        start = containers.find('|*', end, end_abs + 1)
        end = containers.find('|', start + 1, end_abs + 1)

    return items_total


def count_items_in_containers_with_cache(containers, start, end, end_abs):

    # select the fist container in each interaction
    if containers[start] != '|*': start = containers.find('|*', start, end_abs + 1)
    end = containers.find('|', start + 1, end_abs + 1)

    # base checks
    if end == -1: return 0
    if start == -1: return 0

    total_items = 0
    partial_items = 0

    total_items += count_items_in_containers(containers, end, end, end_abs)

    container_pos = (start, end)
    if container_pos in cache:
        partial_items = cache[container_pos]
    else: 
        for item in containers[start: end]:
            if item == '*': partial_items += 1
        
        cache[container_pos] = partial_items

    return partial_items + total_items

def count_items_in_containers(containers, start, end, end_abs):

    # select the fist container in each interaction
    if containers[start] != '|*': start = containers.find('|*', start, end_abs + 1)
    end = containers.find('|', start + 1, end_abs + 1)

    # base checks
    if end == -1: return 0
    if start == -1: return 0

    total_items = 0
    partial_items = 0

    total_items += count_items_in_containers(containers, end, end, end_abs)

    for item in containers[start: end]:
        if item == '*': partial_items += 1

    return partial_items + total_items
    
def count_items_container(list_containers, list_start, list_end):

    # total_item_1 = items_in_container(list_containers, list_start, list_end)
    total_item = []

    for idx_pos in range(len(list_start)):

        start = list_start[idx_pos] - 1 #adjust to base 0
        end_abs = list_end[idx_pos] - 1 #adjust to base 0

        #if (list_start[idx_pos] == 1 and list_end[idx_pos] == 3798) or (list_start[idx_pos] == 1 and list_end[idx_pos] == 4853):
        #    print('Ã© aqui.')

        #total_item.append(count_items_in_containers(list_containers, start, end_abs, end_abs))
        #total_item.append(count_items_in_containers_with_cache(list_containers, start, end_abs, end_abs))
        total_item.append(count_items_in_containers_dinamically(list_containers, start, end_abs, end_abs))

    # for idx in range(len(total_item_1)):
    #     if total_item_1[idx] != total_item[idx]:
    #         print(f'indice: {idx}, item 1: {total_item_1[idx]}; item: {total_item[idx]}')
    #         print(list_start[idx])
    #         print(list_end[idx])

    
    return total_item #== total_item_1


